import React from 'react';
import Item from './Item'

function List(props) {
    // console.log(props)
    const {todos, changeTodoFinished} = props;
    return (
        <ul className="todo-main">
            {
                todos.map((todo, index) => (
                    <Item
                        key={index}
                        todo={todo}
                        changeTodoFinished={changeTodoFinished}
                    />
                ))
            }
        </ul>
    )
}

export default List
